INSERT INTO `courses` (`Course_id`, `Course_name`, `Programme`, `Semester`, `Category`, `Credits`, `Content`, `References`, `Department`, `Instructors`) VALUES
('C)449', 'Major Project - I', 'B.Tech', 'Seventh', 'Programme Major Project (PMP)', 4, 'The Student has to select a project work based on a topic of interest. Periodically the implementation will be evaluated by the guide. This work, started in VII semester continues through eighth semester, at the end of which, the student will be evaluated internally and externally.', '', 'Computer Science and Engineering', 'Saumya Hegde\r\nMohit P. Tahiliani'),
('CO110', 'Computer Programming', 'B.Tech', 'First', 'Engineering Science Core (ESC)', 4, 'Concepts, definitions, taxonomy and history of Computer Programming, Operating systems and Program Execution basics. Problem solving and programming: strategies, programming paradigms,software development life cycle. C programming language: C fundamentals, operators and expressions, Data input and output, Control statements, Functions, Arrays, Pointers, Dynamic memory allocations, Structure and unions, Files, Low- level Programming and Macros.', '1. Brian W. Kernighan and Dennis M. Ritchie, \"The C Programming Language\", Second Edition, PHI.\r\n2. Byron S. Gottfried, \"Program with C\", Second Edition, Schaums Outline Series.\r\n3. Yashavanth Kanetkar, \"Let us C\", BPB Publications, 2002.', 'Computer Science and Engineering', 'Annappa B.\r\nB. R. Chandravarkar\r\nVani M\r\nJenny Rajan'),
('CO201', 'Theory of Computation', 'B.Tech', 'Third', 'Programme Core (PC)', 4, 'Formal Languages and Automata Theory: Generative grammar, Chomsky hierarchy, Finite state Automata: Definition, Concept of Non-determinism, Equivalence of deterministic and Non-deterministic Automata, Relation between CFL and Type3 grammars, Pumping Lemma for CFL, Closure properties, Push down Automata: Definition, Equivalence between NPDA and context free grammars, Pumping Lemma for C.F.L\'s,Decision problems, Closure properties, Turing machines:Definition, extension to turing machines: Multi-track, Multi-tape, and Non determinism, TM as an acceptor, TM as a computing device, Relation between TM and type-0-grammar, Universal Turing Machine, Concept of computability, Undecidable problems, Recursive function theory: Primitive recursive functions, general recursive function, relation between general recursive functions and Turing machines, Church’s thesis, P, NP, NP- Hard & NP- Complete problems.', '1. J.E.Hopcroft and J.D.Ullman, \"Introduction to Automata, Languages and Computation\", Addison Wesley.\r\n2. H. E. Lewis and C. H. Papadimitiou, \"Elements of the Theory of Computation\", Prentice-Hall of India, 1981.\r\n3. Derickwood, \"Theory of Computation\", John Wiley and Sons.', 'Computer Science and Engineering', 'K. Chandra Sekaran\r\nShasidhar G Koolagudi'),
('CO203', 'Data Structures and Algorithms', 'B.Tech', 'Second', 'Programme Core (PC)', 4, 'Algorithm analysis and design techniques. Basic data structures – Stack, Queue and List –their sequential and linked representations, variations, operations with algorithms on these; Trees and graphs and sets - variations, operations and representation methods. Algorithms for Searching & Sorting. Data structures and algorithms for external storage.', '1. Alfred V Aho, John E Hoperoft, Jeffrey D. Ullman. \"Data structures and Algorithms\", Addison Wesley, 2003.\r\n2. Horowitz and Sahni, \"Data Structures and Algorithms using C/C++\", 2003.\r\n3. Mark Allen Weiss, \"Algorithms Data Structures and Problem Solving with C++\", Addison Wesley.', 'Computer Science and Engineering', 'Jeny Rajan'),
('CO254', 'Operating System Lab', 'B.Tech', 'Fourth', 'Programme Core (PC)', 2, 'Linux and/or other OS based exercises to practice/simulate: Scheduling, Memory management Algorithms, Concurrent programming, Use of threads and processes, Kernel reconfiguration, Device drivers and systems administration of different operating systems, Writing utilities and OS ', '1. Silberschartz, Galvin and Gange, \"Operating System Concepts\", Ninth Edition, John Wiley and Sons, 2013.\r\n2. Melin Milenkovic, \"Operating Systems: Concepts and Design\", McGraw Hill New York, 2000.\r\n3. Sumitaba Das, \"Unix Concept and Applications\".', 'Computer Science and Engineering', 'Mohit P. Tahillani\r\n'),
('CO302', 'Computer Networks Lab', 'B.Tech', 'Fifth', 'Programme Core (PC)', 2, 'Exercises comprising simulation of various protocols and performance study; TCP/IP Level Programming, Routing Algorithms and internetworking.', '1. Kris Jamsa, Ken Cope, \"Internet Programming\", Galgotia.\r\n2. Fred Halsall, \"Data Communications, Computer networking on OSI\", Second Edition, Addison Wesley, 2002.\r\n3. Behrouz A. Forouzan, \"Data Communications and Networks\", Third Edition, Tata McGraw Hill.', 'Computer Science and Engineering', ''),
('CO350', 'Compiler Design', 'B.Tech', 'Sixth', 'Programme Core (PC)', 4, 'Introduction to compiler design, Lexical analyzer, Regular expressions and finite automata, Introduction to context free grammars, BNF notation, Parsing Techniques: Top-down parsing and Bottom-up parsing, Error recover strategies for different parsing techniques, Intermediate code generation, symbol table, Runtime storage allocation, Code Optimization, Code generation.', '1. Alfred V. AHO, Ravi Sethi and Jeffrey D. Ullman, \"Compilers; Principles, Techniques and Tools\", Addison-Wesley Publication, 2001.\r\n2. William A. Barrett et.al, \"Compiler Construction, Theory and Practice\", Galgotia 2000.\r\n3. Holub A.I., \"Compiler Design in C\", Prentice Hall India, 2000.', 'Computer Science and Engineering', ''),
('CO469', 'Software Project Management', 'B.Tech', 'Eight', 'Open Electives (OE)', 3, 'Data Collection and Analysis in software engineering, Product Metrics, Quality Metrics, Management Metrics, Conventional Software Management, Life cycle Phases, Iterative process planning, Modern Project Profiles, Next generation cost models.', '1. K. Conway, \"Software Project Management: From Concept to Development\", IDG Books, 2001.\r\n2. I. Jacobson G. Booch and J. Rumbaugh, \"The Unified Software Development Process\", Addison Wesley, 1999.\r\n3. Norman E- Fentar and Share Lawrence Pflieger, \"Software Metrics\", International Thomson Computer Press 1997.', 'Computer Science and Engineering', ''),
('CS03133', 'GK', 'B.Tech', '', '', 1, '', '', '', ''),
('CS03134', 'Social', 'B.Tech', '', '', 1, '', '', '', ''),
('CS700', 'Algorithms and Complexity', 'M.Tech', 'First', 'Programme Core (PC)', 4, 'Algorithmic paradigms: Dynamic Programming, Greedy, Branch-and-bound, Asymptotic complexity, Amortized analysis, Graph Algorithms: Shortest paths, Flow networks; NP-completeness, Approximation algorithms, Randomized algorithms and advanced data structures.', '1.T.H. Cormen, C.E. Leiserson, R.L. Rivest, \"Introduction to Algorithms\", McGraw Hill, 1994.\r\n2.Dan Gusfield, \"Algorithms on Strings, trees and Sequences\", Cambridge, 2005.\r\n3.Sara Baase, \"Computer Algorithms: Introduction to Design and Analysis\", Addison Wesley, 1998.\r\n4.Michael T Goodrich & Roberto Tamassia, \"Algorithm Design: Foundations, Analysis and Internet Examples\", Joh', 'Computer Science and Engineering', ''),
('CS702', 'Database Engineering', 'M.Tech', 'Second', 'Programme Core (PC)', 4, 'Distributed Databases: principles, Architecture, Design, Query Optimization, Transaction Processing, Concurrency control, Integrity and Security, Client/server architecture, Parallel Databases, Web databases, Current trends in database systems.', '1.M.TamerÖzsu, \"Principles of Distributed Database Systems\", Second Edition.\r\n2.Raghu Ramakrishnan, \"Database Management Systems\", McGraw-Hill, 2000.\r\n3.Ceri S and Pelagatti G,\"Distributed Databases Principles and Systems\", Mc.Graw Hill, 1999.', 'Computer Science and Engineering', 'P. Santhi Thilagam'),
('CS803', 'Software Testing', 'M.Tech', 'Third', 'Elective Courses (Ele)', 4, 'Software testing concepts & principles, Testing Strategies, Testability and Related Issues, Methods for developing the strategy, Life Cycle Testing, Installation Phase Testing and Various Phases of Testing; Tools and Techniques for Software Testing, Testing Object Oriented Software.', '1.Glenford J. Myers, \"The Art of Software Testing\", John Wiley & Sons, 1979.\r\n2.Boris Beizer, \"Black Testing: Techniques for Functional Testing of Software and Systems\", John Wiley and Sons, 1995.\r\n3.William Perry, \"Software Testing: Effective Methods for Software Testing\", John Wiley, 1995\r\n4.Cem Kaner, Jack Falk, Hung Quoc Nguyen, \"Testing Computer Software\", Second Edition, Intl. Thomson Computer Press.', 'Computer Science and Engineering', 'Annappa'),
('CS821', 'Wireless Networks', 'M.Tech', '', 'Elective Courses (Ele)', 3, 'Overview of wireless communications and networking, Transmission fundamentals, Communication networks, TCP/IP protocol stack overview, Basic wireless communication technology, channel uncertainties and countermeasures, Coding and error control. Mobile IP and wireless access protocol4. Cellular wireless networks, Overview of cellular systems (TDMA, GSM, CDMA, 3G/UMTS), Wireless LAN systems, Bluetooth, Zigbee and UWB standards, Erlang formulas.', '1.Rappaport, Theodore S., \"Wireless Communications, Principles and Practice\", Prentice Hall, Inc, 2002.\r\n2.Kaveh Pahlavan, Prashant Krishnamoorthy, \"Principles of Wireless Networks, - A united approach\", Pearson Education, 2002.', 'Computer Science and Engineering', ''),
('CS822', 'Topics in Computer Networks', 'M.Tech', 'Second', 'Elective Courses (Ele)', 3, 'TCP/IP Protocol Suite and Protocols in different Layers, QOS, Load Balancing, Traffic Engineering. Case study: Data center networks, Virtual networks, Mesh networks. Emerging concepts in next generation networks.', '1.Mahbub Hassan, Raj Jain, \"High Performance TCP/IP Networking\", Prentice Hall, 2004.\r\n2.Dennis Abts, John Kim, \"High Performance Data Center Networks: Architectures, Algorithms and Opportunities\", Morgan and Claypool Publishers, 2010.\r\n3.Recent papers on advancement in Computer Networks.', 'Computer Science and Engineering', ''),
('CS902', 'Network Management', 'Ph.D', '', '', 4, 'Network management Overview, Network Management, SNMP and Network Management, TMN, Network Management Applications, Management of Heterogeneous Network with Intelligent Agents, Network Security Management, Internet Management(IEEE Communication May, Oct /03), QoS in IP Network, Basic Methods and Theory for Survivable Network Design and Operation, Network Planning, Network Management Standards.', '1. Subramanian M., \"Network Management: Principles and Practice\", Addson – Wesly, 2000.\r\n2. James F. Kurose and Keith W. Rose,\" Computer Networking\", Pearson Education, LPE, 2003.\r\n3. Burke J., \"Network Management Concepts and Practice\", A Hands- On Approach, Pearson Education.\r\n4. John Strassner, \"Policy based Network Management\", Elsevier India, 2004.', 'Computer Science and Engineering', ''),
('CS905', 'Bioinformatics', 'Ph.D', '', '', 4, 'Introduction to Bioinformatics, Biological Databanks, Sequence Analysis, Structure Prediction, Protein Folding, Proteomics, Emerging Areas in Bioinformatics.', '1. Krane D.E. and Raymer M.L, \"Fundamental Concepts of Bioinformatics, Pearson\", 2003.\r\n2. Attwood and Parrysmith,\" Introduction to Bioinformatics\", Pearson Ed, 2003.\r\n3. Zoe.L and Terenee. C,\"Bioinformatics\", Elseiver, 2004.', 'Computer Science and Engineering', ''),
('CS913', 'Intelligent Information Retrieval', 'Ph.D', '', '', 4, 'Overview of IR Systems, Historical Perspectives, Basic Evaluation, Document Representation: Statistical Characteristics of Text, Basic Query Processing, Data Structure and File Organization for IR, Automatic Indexing and Indexing Models, Retrieval Models: Similarity Measures and Ranking, Boolean Matching, Vector Space Models, Probabilistic Models, Search and Filtering Techniques: Relevance Feedback, User Profiles, Collaborative Filtering, Document and Term Clustering, Document Categorization, IR Systems and the WWW, Heterogeneous Information Sources, Intelligent Web Agents, Web Mining and Its Applications.', '1. D. Grossman and O. Frieder,\"Information Retrieval: Algorithms and Heuristics\", Kluwer Academic Press.\r\n2. Richard K. Belew, \"Finding Out About: A Cognitive Perspective on Search Engine Technology and the WWW\", Cambridge University Press, 2001.\r\n3. C. J. van Rijsbergen , \"Information Retrieval\".', 'Computer Science and Engineering', ''),
('IS822', 'Advanced Cryptography', 'M.Tech', 'Fourth', 'Elective Courses (Ele)', 3, 'Objectives of cryptography, Symmetric Key Encryption- Stream ciphers & Block ciphers, Public-Key cryptography: RSA, Hash-functions, Discrete logarithm, Modular Squaring, Cryptographic Protocols: Key exchange & entity authentication, identification schemes, commitment schemes, electronic elections, Probabilistic algorithms, probably secure encryption & Digital signatures. Mathematical Models for Internet: Design and control communication networks that respond to: randomly fluctuating demands and failures by adapting rates, by rerouting traffic and by reallocating resources, stability and fairness of rate control algorithms for the Internet; economic issues, scalable models of simulation of such networks, Quantum Cryptography.', '1.Wenbo Mao, \"Modern Cryptography- Theory and Practice\", Prentice Hall, 2004.\r\n2.Susan Loepp and William K. Wooters, \"Protecting Information (Quantum Cryptography)\", Cambridge, 2005.\r\n3.Hans DelFs and Helmutt Knebl, \"Introduction to cryptography: Principles and Application\", Springer Verlag.', 'Computer Science and Engineering', '');

